window.bookSummaryJSON = "<p>The three fae kings insist that I'm their fated mate, but they're terrible at sharing. I know I should turn my back on them before they ruin me.</p> <p>They're too feral, ruthless, and possessive. And too hot for their own good.</p> <p>A girl would have a better chance swimming with sharks than tangling with the predatory fae kings between the sheets.</p> <p>“I’ll ravish you for hours. Days. I won’t ever stop.” That’s the fae kings’ ritual of claiming. I rolled my eyes. “Sorry I asked.”</p> <p>This darkly sexy reverse harem fantasy romance boxed set includes:</p> <p></p> <ul> <li>Book one: <i>Fever Fae</i></li> <li>Book two: <i>Frost Fae</i></li> <li>Book three: <i>Night Fae</i></li> <li>Book four: <i>Blood Fae</i></li> </ul> <p>If you love badass heroines, possessive males who take no prisoners when it comes to their women, and lots of steam and heart-pounding action, you’ll enjoy this sizzling hot collection! Perfect for fans of Ilona Andrews, Sarah J. Maas, Laura Thalassa, C. N. Crawford, K.F. Breene, Karen Marie Morning, and Amelia Hutchins.</p>"; 
